import React from "react";
import "./App.css";

// Sample book data
const books = [
  {
    id: 1,
    title: "The Alchemist",
    author: "Paulo Coelho",
    rating: 4.5,
    review: "An inspiring story about following your dreams."
  },
  {
    id: 2,
    title: "1984",
    author: "George Orwell",
    rating: 4.8,
    review: "A chilling vision of a dystopian future."
  },
  {
    id: 3,
    title: "To Kill a Mockingbird",
    author: "Harper Lee",
    rating: 4.7,
    review: "A timeless classic about justice and morality."
  }
];

function App() {
  return (
    <div className="app">
      <header>
        <h1>üìö Book Review App</h1>
      </header>
      <div className="book-list">
        {books.map((book) => (
          <div key={book.id} className="book-card">
            <h2>{book.title}</h2>
            <h4>by {book.author}</h4>
            <p>‚≠ê {book.rating}</p>
            <p className="review">{book.review}</p>
            <button>Read More</button>
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
